import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from "react-router-dom";
import axios from 'axios';
import { Container, Row, Col, Table, Button, Card } from 'react-bootstrap';
import NavSc from '../componentes/navbar';
import Bootfooter from '../componentes/BSfooter';
import logo5 from '../logo5.png';
import logo6 from '../logo6.png';
import funcionariosService from '../services/funcionarioService';


function Funcionarios() {

  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    async function fetchTableData() {

      try {
        //const response = await axios.get('http://localhost:2527/api/funcionarios');
        const response = await funcionariosService.getFuncionarios();
        setTableData(response.data);
      } catch (error) {
        console.error(error);
      }

    };
    fetchTableData();
  }, [tableData]);

  async function handleDelete(id) {
    var confirma = window.confirm('Confere?');
    if (confirma) {
      try {
        //await axios.delete(`http://localhost:2527/api/deltfuncionarios/${id}`);
        await funcionariosService.deltFuncionarios(id);
        alert('deletado com sucesso!');
      } catch (error) {
        console.error(error);
      }
    }
  }
  return (

    <Container fluid>
      <Row>
        <Col>
          <NavSc />
        </Col>
      </Row>

      <Card>
        <Card.Body>
          <Row>
            <Button variant="success" className='text-justify-content-end' href='../funcsalas'>
              Incluir 
            </Button>
          </Row>

          <Row>  
            <Table striped bordered hover variant="light">
              <thead>
                <tr>
                  <th>CPF</th>
                  <th>NOME</th>
                  <th>CEP</th>
                  <th>EMAIL</th>
                  <th>TELEFONE</th>
                  <th>FUNÇÃO</th>
                  <th>EDITAR</th>
                  <th>DELETE</th>
                </tr>
              </thead>
              <tbody>
                {tableData.map((row, index) => {
                  return (
                    <tr key={index} data-toogle="tooltip" title={row.cep}>
                      <td>{row.cpf}</td>
                      <td>{row.nome}</td>
                      <td>{row.cep}</td>
                      <td>{row.email}</td>
                      <td>{row.fone}</td>
                      <td>{row.funcao}</td>
                      <td><a href={`/funcsalas/${row._id}`}>
                        <img src={logo5} alt='logo5'></img>
                      </a>
                      </td>
                      <td><a href='#'>
                        <img src={logo6} alt='logo6' onClick={() => handleDelete(row._id)} ></img>
                      </a>
                      </td>
                    </tr>
                  );
                })}
              </tbody>
            </Table>
            <Button variant="warning" size='lg' href='../index'>
              Retornar
            </Button>
          </Row>
        </Card.Body>
      </Card>

      <Bootfooter />

    </Container>
  );
}

export default Funcionarios;
